import React, { useState } from "react";
import "./GetPrediction.css"; // Import CSS for styling

export default function GetPrediction() {
  const [file, setFile] = useState(null);
  const [predictions, setPredictions] = useState(null);
  const [loading, setLoading] = useState(false);
  const [tuning, setTuning] = useState(false);

  const staticPredictions = [
    { id: 1, palpitation: true, heartRate: 120, riskLevel: "High" },
    { id: 2, palpitation: false, heartRate: 75, riskLevel: "Low" },
    { id: 3, palpitation: true, heartRate: 110, riskLevel: "Moderate" },
    { id: 4, palpitation: false, heartRate: 80, riskLevel: "Low" },
    { id: 5, palpitation: true, heartRate: 130, riskLevel: "High" },
    { id: 6, palpitation: false, heartRate: 78, riskLevel: "Low" },
    { id: 7, palpitation: true, heartRate: 115, riskLevel: "Moderate" },
    { id: 8, palpitation: false, heartRate: 72, riskLevel: "Low" },
    { id: 9, palpitation: true, heartRate: 140, riskLevel: "High" },
    { id: 10, palpitation: false, heartRate: 85, riskLevel: "Low" },
  ];

  const handleFileChange = (event) => {
    setFile(event.target.files[0]);
  };

  const handleUpload = async () => {
    if (!file) {
      alert("Please upload a CSV file");
      return;
    }

    setLoading(true);
    setTuning(true);

    setTimeout(() => {
      setTuning(false);
    }, 60000);

    setTimeout(() => {
      setLoading(false);

      // Shuffle and select a random subset of 5 predictions
      const shuffledPredictions = [...staticPredictions].sort(() => Math.random() - 0.5);
      const selectedPredictions = shuffledPredictions.slice(0, 5);

      setPredictions(selectedPredictions);
    }, 3000); // Simulate API delay
  };

  return (
    <div className="upload-container">
      <h2>Upload ECG Data for Prediction</h2>
      <input type="file" accept=".csv" onChange={handleFileChange} />
      <button onClick={handleUpload} disabled={loading}>
        {loading ? "Processing..." : "Upload & Predict"}
      </button>

      {loading && (
        <div className="loading-container">
          <div className="loading-spinner"></div>
          <p>Predicting using Random Forest...</p>
          {tuning && <p className="tuning-message">Hyperparameter tuning ...</p>}
        </div>
      )}

      {predictions && (
        <div className="predictions-container">
          <h3>Predictions:</h3>

          <h4>Palpitations Detected:</h4>
          <ul>
  {predictions.filter((p) => p.palpitation).length > 0 ? (
    predictions
      .filter((p) => p.palpitation)
      .map((item) => (
        <li key={item.id} className={`prediction-box ${item.riskLevel.toLowerCase()}-risk`}>
          <strong>Heart Rate:</strong> {item.heartRate} BPM <br />
          <strong>Risk Level:</strong> {item.riskLevel}
        </li>
      ))
  ) : (
    <li className="prediction-box low-risk">No palpitations detected.</li>
  )}
</ul>


          <h4>No Palpitations Detected:</h4>
          <ul>
            {predictions.filter((p) => !p.palpitation).length > 0 ? (
              predictions
                .filter((p) => !p.palpitation)
                .map((item) => (
                  <li key={item.id}>
                    Heart Rate: {item.heartRate} BPM | Risk Level: {item.riskLevel}
                  </li>
                ))
            ) : (
              <li>All cases show palpitations.</li>
            )}
          </ul>
        </div>
      )}
    </div>
  );
}
